import styled from 'styled-components';
import { flex } from 'styles/flex';
import { font } from 'styles/fonts';
import Input from 'pages/Auth/components/Input';

export default function Login() {
  return (
    <Container>
      <Title>다시 오신 것을 환영합니다</Title>
      <SubTitle>세부 사항을 입력해주세요.</SubTitle>
      <Input
        autoFocus
        title="로그인"
        placeholder="이메일을 입력해 주세요"
        onChangeInput={() => {}}
      />
      <Input
        title="패스워드"
        placeholder="이메일을 입력해 주세요"
        onChangeInput={() => {}}
        type="password"
        isError={true}
        subText="비밀번호를 확인해주세요."
      />
      <Button>로그인</Button>
    </Container>
  );
}

const Container = styled.div`
  width: 500px;
  margin: 100px auto 0;
  padding: 60px 40px 0;
  text-align: center;
`;

const Title = styled.h1`
  ${font(24, 700, 30)}
  color: #C58940;
`;

const SubTitle = styled.h3`
  ${font(14, 400, 16)}
  margin : 12px 0 30px;
  color: #c58940;
`;

const Button = styled.button`
  display: block;
  margin: 50px auto 0;
  width: 420px;
  ${font(16, 700, 18)};
  color: white;
  padding: 15px;
  border-radius: 10px;
  background-color: #c58940;
`;
